import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";
import moment from "moment";
import { EventResponse } from "../../../requests/eventTypes";

type Props = {
  event: EventResponse;
};

const EventCard = ({ event }: Props) => {
  const { name, date, attendees, rsvps } = event;
  return (
    <Card>
      <CardTitle>{event.eventName}</CardTitle>
      <CardSubtitle>{moment(event.eventDate).format("MM/DD/YY")}</CardSubtitle>
      <CardText>
        Attendance: {event.attendees} / {event.rsvps} ({Math.round()})
      </CardText>
    </Card>
  );
};

export default EventCard;
